// src/components/Results.js
import React from 'react';
import './Results.css';

const Results = () => {
    return (
        <div className="results">
            <h3>Resultados</h3>
            <p>Aquí se mostrarán los instrumentos identificados a partir de las grabaciones de audio.</p>
            {/* Ejemplo de datos */}
            <ul>
                <li>Quena: 60%</li>
                <li>Charango: 40%</li>
            </ul>
        </div>
    );
};

export default Results;
